(1, 'about', 'About', '<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p><p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.<br>Lorem ipsum dolor sit amet, consectetur adipiscing elit.<span class=\"redactor-invisible-space\"><br><br>Lorem ipsum dolor sit amet, consectetur adipiscing elit.<span class=\"redactor-invisible-space\"></span></span></p><p><span class=\"redactor-invisible-space\">Lorem ipsum dolor sit amet, consectetur adipiscing elit.<span class=\"redactor-invisible-space\"><br>Lorem ipsum dolor sit amet, consectetur adipiscing elit.<span class=\"redactor-invisible-space\"></span></span></span></p><p><span class=\"redactor-invisible-space\"><span class=\"redactor-invisible-space\">Lorem ipsum dolor sit amet, consectetur adipiscing elit.<span class=\"redactor-invisible-space\"></span></span></span></p><p><span class=\"redactor-invisible-space\"><span class=\"redactor-invisible-space\"><br>Lorem ipsum dolor sit amet, consectetur adipiscing elit.<span class=\"redactor-invisible-space\"><br>Lorem ipsum dolor sit amet, consectetur adipiscing elit.<span class=\"redactor-invisible-space\"></span></span></span></span></p><p><span class=\"redactor-invisible-space\"><span class=\"redactor-invisible-space\"><span class=\"redactor-invisible-space\">Lorem ipsum dolor sit amet, consectetur adipiscing elit.<span class=\"redactor-invisible-space\"><br></span><br></span><br></span><br></span><br></p>', '', 1, 1548831664, 1548832604),
(2, 'rules', 'Правила', '<p>Что нельзя делать на Фрилансим</p><p>На Фрилансим действует ряд правил, которые касаются размещения заказов, откликов, комментариев и постов в Клубе, информации в профиле, портфолио и других местах.</p><p>Правила простые — например, мы просим вас не оскорблять друг друга и не размещать недостоверную информацию. Они разделены на группы — <a href=\"https://freelansim.ru/info/common_rules\">общие</a>, <a href=\"https://freelansim.ru/info/tasks_rules\">правила размещения заказов</a>, <a href=\"https://freelansim.ru/info/responses_rules\">откликов</a> и <a href=\"https://freelansim.ru/info/club_rules\">общения в Клубе</a>.</p><p>В случае нарушений правил мы оставляем за собой право редактирования и скрытия с сайта заказов, откликов, постов, комментариев или блокировки аккаунта — выбор санкций зависит от частоты и масштаба нарушений.</p><p>Если ваш заказ, отклик, комментарий или пост скрыли с сайта или ваш аккаунт заблокировали, но вы не знаете, за что именно, или хотите задать какие-то уточняющие вопросы, пишите нам в <a href=\"https://freelansim.ru/feedback\">службу поддержки</a>.</p><p>Если кто-то другой нарушил правила и вы хотите сообщить нам об этом, пожалуйста, помните, что мы не можем проводить расследования за пределами сервиса Фрилансим, как не можем и предоставить данные одних пользователей — другим, даже если это данные недобросовестного фрилансера или заказчика, мы действуем в рамках российского законодательства. Иногда в конфликтных ситуациях мы можем попросить вас обратиться в полицию или в суд — это необходимо, чтобы мы смогли помочь вам в решении конфликта законными способами.</p><p>Сотрудники службы поддержки оставляют за собой право прекращать диалог, если общение ведется в грубой и оскорбительной форме. Давайте с уважением относиться друг к другу!</p>', '', 1, 1560235414, 1560235414);
