INSERT INTO `site_block` (`id`, `name`, `type`, `data`, `sort`, `text`, `site_id`, `status`) VALUES
(2, 'Где меня найти', 2, 'null', 2, '', 1, 0),
(3, 'Это мой любимый клип', 3, 'null', 0, '<div\r\n class=\"block-iamge-bg\" \r\n style=\"\r\n       background: url(/upload/professiolog/bg.png);\r\n       \">\r\n<br>\r\n<center>\r\n  <img src=\"/upload/professiolog/header-logo.png\" alt=\"Главная\"><br>\r\n<a href=\"tel:83472464655\" class=\"phone\" style=\"\">8 (347) 246-46-55</a>\r\n</center>\r\n</div>', 1, 0),
(13, 'title...', 3, 'null', 1, '\r\n<img\r\n  class=\"rounded\" \r\n  title=\"Верное решение\" \r\n  src=\"http://professiolog.ru/images/good_photo/IMG_3192.jpg\" \r\n  alt=\"рустем калимуллин\"\r\n style=\"    float: left;\r\n                width: 129px;\r\n               margin: 18px;\r\n\"\r\n>\r\nРазрешите представиться: <b>Рустэм Калимуллин</b>, инициатор создания профориентационного сайта <b>ПРОФЕССИОЛОГ.РФ</b>\r\n<p>\r\nПо образованию я психолог, и вот уже более 15 лет помогаю людям принимать верные решения при выборе профессии. Вместе с командой \r\nединомышленников мы будем рады помочь и Вам в этом непростом и очень важном выборе. \r\n</p>\r\n<center>Добро пожаловать на сайт профориентации и планирования карьеры Профессиолог.РФ!\r\n</center>\r\n', 1, 0),
(19, 'title...', 3, 'null', 4, '<iframe width=\"100%\" height=\"auto\" src=\"https://www.youtube.com/embed/_jSkdpZEYf8\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', 1, 0),
(20, 'title...', 1, 'null', 1, 'Привет! Меня зовут  Денис Кагарманов.\r\nЯ люблю программировать и играть на гитаре. Прогрммирование - моя работа и хобби. Есть много веб-проектов (интрнет магазины, каталоги, CRM). Написал несколько игр на Android.\r\n\r\n- Знаю и умею: \r\n     Yii2 - мой любимый фреймворк на PHP\r\n     Bitrix - написал много чего, начиная от лендингов заканчивая CRM\r\n     Unity3D (C#) - отличаня платформа для создания игр и приложений. \r\n     Cordova - на JavaScript написал 6 приложений\r\n     Java + Android Studio - будучи молодым писал игры на нем', 13, 1),
(21, 'title...', 2, '[]', 3, 'Вы можете меня найти тут:', 13, 1),
(22, 'title...', 3, 'null', 0, '<div style=\"text-align:center\">\r\n<img style=\" width: 138px;\" src=\"/upload/deen812/ava.jpg\" class=\"rounded ava\">\r\n</div>', 13, 1),
(23, 'title...', 3, 'null', 4, '', 13, 1),
